import React, { Component } from 'react';

import Header from '../components/Header'

class index extends Component {

  render() {
    return (
      <div>
        <Header />
        <div className="bg">
          <div className="container">
            <section className="d-flex align-items-center justify-content-center intro">
              <h1 class="display-4 pt-5 text-center text-info">
                The smart way to own your home
              </h1>
            </section>

            <section>
              <div className="d-flex flex-column mt-5  bg-warning">
                <div className="d-flex justify-content-center align-items-center circle my-3">
                  <i class="fas fa-chart-area fa-7x"></i>
                </div>
                <div className="d-flex justify-content-center align-items-center circle my-3">
                  <i class="fas fa-vr-cardboard fa-7x" />
                </div>
                <div className="d-flex justify-content-center align-items-center circle my-3">
                  <i class="fas fa-bell fa-7x"></i>
                </div>
              </div>
            </section>
          </div>
        </div>
      <style>{`
          img {
            opacity: 0.7;
            background-size: cover;
            display: block;
          }

          h1 {
            font-family: lato;
          }

          .bg {
            background: black;
          }

          .intro {
            height: 600px;;
            background: yellow;
          }

          i {
            color: #17a2bb;
            color: white
          }

          .circle {
            height: 200px;
            width: 200px;
            background: pink;
            border-radius: 100px;
            border: 1px solid white;
          }

        `}</style>
      </div>
    );
  }
}

export default index;
